// koffee 1.20.0
var Kode, assert, chai, fs, kode, koffee, lexer, parser, path, renderer;

assert = require('assert');

chai = require('chai');

path = require('path');

fs = require('fs');

koffee = require('koffee');

Kode = require('../');

chai.should();

kode = new Kode();

lexer = kode.lexer;

parser = kode.parser;

renderer = kode.renderer;

describe('modules', function() {
    it('tokenize', function() {
        return lexer.tokenize('a=b').should.eql([
            {
                col: 0,
                line: 1,
                text: 'a',
                type: 'var'
            }, {
                col: 1,
                line: 1,
                text: '=',
                type: 'op'
            }, {
                col: 2,
                line: 1,
                text: 'b',
                type: 'var'
            }
        ]);
    });
    it('blockify', function() {
        return lexer.blockify(lexer.tokenize("if 1\n    a=b")).should.eql({
            type: 'block',
            tokens: [
                {
                    type: 'keyword',
                    text: 'if',
                    line: 1,
                    col: 0
                }, {
                    type: 'num',
                    text: '1',
                    line: 1,
                    col: 3
                }, {
                    type: 'block',
                    indent: '    ',
                    tokens: [
                        {
                            col: 4,
                            line: 2,
                            text: 'a',
                            type: 'var'
                        }, {
                            col: 5,
                            line: 2,
                            text: '=',
                            type: 'op'
                        }, {
                            col: 6,
                            line: 2,
                            text: 'b',
                            type: 'var'
                        }
                    ],
                    line: 2,
                    last: 2,
                    col: 4
                }
            ],
            indent: '',
            line: 1,
            last: 1,
            col: 0
        });
    });
    it('parse', function() {
        parser.parse(lexer.blockify(lexer.tokenize("if a then b else c"))).should.eql([
            {
                "if": {
                    exp: {
                        col: 3,
                        line: 1,
                        text: "a",
                        type: "var"
                    },
                    "else": [
                        {
                            col: 17,
                            line: 1,
                            text: 'c',
                            type: 'var'
                        }
                    ],
                    then: [
                        {
                            col: 10,
                            line: 1,
                            text: 'b',
                            type: 'var'
                        }
                    ]
                }
            }
        ]);
        parser.parse(lexer.blockify(lexer.tokenize("a.b.c", "prop:\n    obj:\n        prop:\n            obj:\n                type:    'var'\n                text:    'a'\n                line:    1\n                col:     0\n            dot:\n                type:    'punct'\n                text:    .\n                line:    1\n                col:     1\n            prop:\n                type:    'var'\n                text:    'b'\n                line:    1\n                col:     2\n    dot:\n        type:    'punct'\n        text:    '.'\n        line:    1\n        col:     3\n    prop:\n        type:    'var'\n        text:    'c'\n        line:    1\n        col:     4")));
        return parser.parse(lexer.blockify(lexer.tokenize("a.b.c"))).should.eql([
            {
                prop: {
                    obj: {
                        prop: {
                            obj: {
                                type: 'var',
                                text: 'a',
                                line: 1,
                                col: 0
                            },
                            dot: {
                                type: 'punct',
                                text: '.',
                                line: 1,
                                col: 1
                            },
                            prop: {
                                type: 'var',
                                text: 'b',
                                line: 1,
                                col: 2
                            }
                        }
                    },
                    dot: {
                        type: 'punct',
                        text: '.',
                        line: 1,
                        col: 3
                    },
                    prop: {
                        type: 'var',
                        text: 'c',
                        line: 1,
                        col: 4
                    }
                }
            }
        ]);
    });
    return it('render', function() {
        return renderer.render(parser.parse(lexer.blockify(lexer.tokenize("if a then b else c")))).should.eql("if (a)\n{\n    b\n}\nelse\n{\n    c\n}");
    });
});

